import { gtThanLength } from '../';
describe('gtThanLength', function () {
  it('[{}, {}] should not be < 2', function () {
    expect(gtThanLength(2, [{}, {}])).toBeFalsy();
  });
  it('[] should be > 5', function () {
    expect(gtThanLength(5, [])).toBeTruthy();
  });
  it('should support curry', function () {
    var lengthSmallerThanFive = gtThanLength(5);
    expect(lengthSmallerThanFive([{}])).toBeTruthy();
  });
});